INSERT INTO `law` (`id`, `no`, `name`, `dateVoting`, `url`, `urlVoting`, `good`, `tagYes`, `descYes`, `tagNo`, `descNo`) VALUES
('1058', '1058', 'Проект Закону про внесення змін до деяких законодавчих актів України', '2015-02-12 00:00:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=52471', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=805', 1, 'новатор', 'Підтримано зняття регуляторних бар''єрів для розвитку державно-приватного партнерства в Україні та стимулювання інвестицій', 'ретроград', 'Не підтримано зняття регуляторних бар''єрів для розвитку державно-приватного партнерства в Україні та стимулювання інвестицій'),
('1558-1', '1558-1', 'Закон про реструктуризацію зобов''язань за кредитами в іноземній валюті', '2015-07-02 00:00:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=53099', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=3049', 0, 'популіст', 'Підтримано реструктуризацію зобов''язань за кредитами в іноземній валюті за курсом на момент їх отримання', 'конструктив', 'Не підтримано реструктуризацію зобов''язань за кредитами в іноземній валюті за курсом на момент їх отримання'),
('1565', '1565', 'Проект Закону про особливості здійснення права власності у багатоквартирному будинку', '2015-05-14 00:00:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=53058', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=1953', 1, 'новатор', 'Підтримано ліквідацію монополії ЖЕКів', 'ретроград', 'Не підтримано ліквідацію монополії ЖЕКів'),
('1580', '1580', 'Проект Закону про внесення змін до деяких законодавчих актів України щодо спрощення умов ведення бізнесу', '2015-02-12 00:00:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=53076', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=785', 1, 'новатор', 'Підтримано дерегуляцію', 'ретроград', 'Не підтримано дерегуляцію'),
('2087а', '2087а', 'Проект Закону про внесення змін до деяких законів України у сфері державних закупівель щодо приведення їх у відповідність з міжнародними стандартами та вжиття заходів з подолання корупції', '2015-09-04 11:05:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=55593', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=3591', 1, 'новатор', 'Підтримано спрощення процедури держзакупівель', 'ретроград', 'Не підтримано спрощення процедури держзакупівель'),
('2172', '2172', 'Законопроект про внесення змін до статті 28 Бюджетного кодексу України щодо доступу до інформації про бюджетні показники у формі відкритих даних', '2015-04-09 00:00:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=54101', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=1453', 1, 'новатор', 'Підтримано доступ до інформації про бюджетні показники у формі відкритих даних', 'ретроград', 'Не підтримано доступ до інформації про бюджетні показники у формі відкритих даних'),
('2250', '2250', 'Проект Закону про ринок природного газу', '2015-04-09 16:50:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=54205', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=1441', 1, 'новатор', 'Підтримано демонополізацію ринку природного газу', 'ретроград', 'Не підтримано демонополізацію ринку природного газу'),
('2258', '2258', 'Законопроект про внесення змін до Бюджетного кодексу України щодо державних інвестиційних проектів', '2015-04-07 00:00:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=54218', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=1333', 1, 'новатор', 'Сприяння в отриманні інвестицій на 800 мільйонів доларів Світового банку і японського уряду', 'ретроград', 'Перешкодження в отриманні інвестицій на 800 мільйонів доларів Світового банку і японського уряду'),
('2381', '2381', 'Законопроект про внесення змін до Податкового кодексу України (щодо спрощення умов ведення бізнесу)', '2015-04-21 00:00:00', 'http://w1.c1.rada.gov.ua/pls/zweb2/webproc4_1?pf3511=54405', 'http://w1.c1.rada.gov.ua/pls/radan_gs09/ns_golos?g_id=1576', 1, 'новатор', 'Підтримано зменшення кількості процедур і часу реєстрації суб''єктів господарювання у фіскальній сфері та покращення позиції України в рейтингу Doing Business', 'ретроград', 'Не підтримано зменшення кількості процедур і часу реєстрації суб''єктів господарювання у фіскальній сфері та покращення позиції України в рейтингу Doing Business'),
('відвідуваність', '', 'Реєстрація депутата за допомогою електронної системи', NULL, '', NULL, 1, 'працює', 'Відвідано не менше половини засідань', 'прогулює', 'Прогуляно більше половини засідань'),
('шокін', '', 'Постанова про звільнення гепрокурора Віктора Шокіна', NULL, 'https://goo.gl/ThzeTx', NULL, 1, 'шокін-геть', 'Підписано постанову про звільнення гепрокурора Віктора Шокіна', 'шокін-ок', 'Не підписано постанову про звільнення гепрокурора Віктора Шокіна');
